import React from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
import { styles } from "./styles";

const ImageCasa = require("../../assets/casa.png");
const ImageExtrato = require("../../assets/Extrato.png");
const ImageTransferenciasPreto = require("../../assets/TransferenciasDark.png");
const ImageProdutos = require("../../assets/Produtos.png");
const ImageAjudaPreto = require("../../assets/AjudaDark.png");

const Footer = () => {
  return (
    <View style={styles.footer}>
      <View>
        <TouchableOpacity>
          <Image source={ImageCasa} style={styles.casa} />
        </TouchableOpacity>
      </View>
      <View>
        <TouchableOpacity style={styles.viewFooter}>
          <Image source={ImageExtrato} style={styles.imageExtratoFooter} />
          <Text>extrato</Text>
        </TouchableOpacity>
      </View>
      <View>
        <TouchableOpacity style={styles.viewFooter}>
          <Image
            source={ImageTransferenciasPreto}
            style={styles.imagesFooter}
          />
          <Text>transações</Text>
        </TouchableOpacity>
      </View>
      <View>
        <TouchableOpacity style={styles.viewFooter}>
          <Image source={ImageProdutos} style={styles.imagesFooter} />
          <Text>produtos</Text>
        </TouchableOpacity>
      </View>
      <View>
        <TouchableOpacity style={styles.viewFooter}>
          <Image source={ImageAjudaPreto} style={styles.imagesFooter} />
          <Text>ajuda</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

export default Footer;
